import React from "react";

function AboutPage() {
  return (
    <div className="container">
      <div className="row">
        <h2>
          We pioneered the discount broking model in India. Now, we are breaking
          ground with our technology.
        </h2>
      </div>
    </div>
  );
}

export default AboutPage;
